import './Section4.css';
import Fleche_Bas from '../static/fleche_bas.svg';
import Fleche_Bas_Purple from '../static/fleche_bas_purple.svg';
import Logo_ReactNative from '../static/portfolio/reactnative/logo_reactnative.png';
import video_old from '../static/portfolio/reactnative/video_myvr_old.mp4';
import logo_angular from '../static/logo_angular.svg';

const Section4 = () => {

    return(
        <div id="section4">
            <img className="down_arrow" alt="down arrow to go to resume" src={Fleche_Bas}  onClick={() => window.fullpage_api.moveSectionDown()}/>
            <img className="down_arrow da2" alt="down arrow to go to resume" src={Fleche_Bas_Purple}/>
            <h1 className="titre_sec3">IT Projects</h1>
            <h1 className="titre_sec3 ombre_sec3">IT Projects</h1>
            <div className="p_mainbloc">
                <div className="p_bloc1">
                    <h2>Redesign of MyVR, a React Native App created by ViaRezo, my school's network association.</h2>
                    <h3>An animation is worth a thousand words...</h3>
                {/* <video className="video_old" autoplay="autoplay" muted loop disablePictureInPicture>
                    <source src={video_old} type="video/mp4" />
                </video> */}
                </div>
                <div className="p_bloc2">
                    <h2>Manager of the project for the update of the main website of Viarezo</h2>
                    <div className="vitrineinfos">
                        <h3>{'>>'} Adding of the numerous ViaRezo's partners on the website</h3>
                        <h3>{'>>'} Modification of several design aspects</h3>
                        <h3>{'>>'} Management of the team, the calendar related to the project and the meetings.</h3>
                        <div className="angular">
                            <h3>{'>>'} Using Angular </h3>
                            <img src={logo_angular} alt="logo Angular" className="logoangular"/> 
                        </div>
                      
                    </div>
                    <div className="checkthewebsite">
                        <h2>Check the <a href="https://viarezo.fr/">website here !</a></h2>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default Section4;
